import React, { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";
import { Button, Row, Col } from 'antd';
import axios from 'axios';

const AdministracionDeCuentasAjustador = () => {
  const navigate = useNavigate();
  const [nombres, setNombres] = useState('');
  const [apellidos, setApellidos] = useState('');
  const [edad, setEdad] = useState('');
  const [sexo, setSexo] = useState('');
  const [telefono, setTelefono] = useState('');
  const [correo, setCorreo] = useState('');
//datos del veiculo
  const [kilometrajeInicial, setkilometrajeInicial] = useState('');
  const [NumeroLLave, setNumeroLLave] = useState('');
  const [ModeloVehiculo, setModeloVehiculo] = useState('');
  const [placas, setPlacas] = useState('');
  const [tajetaGasolina, setTarjetaGasolina] = useState('');

  
//datos del calular
const [ModeloCelular, setModeloCelular] = useState('');
const [IMEI, setIMEI] = useState('');
const [Numero, setNumero] = useState('');








  const nombreCompleto = nombres + " " + apellidos;

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };

  useEffect(() => {
    const Id = localStorage.getItem('Id_Usuario');
    const token = localStorage.getItem('token');

    const obtenerImagenDeUsuario = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/Ajustadores/ConsultarAjustadoresPorId/${encodeURIComponent(Id)}`, {
          headers: {
            'Authorization': token
          }
        });
        console.log("Respuesta de la consulta:", response.data);

        if (response.data && response.data.registro && response.data.registro.length > 0) {
          const primerRegistro = response.data.registro[0];
          setNombres(primerRegistro.Nombres);
          setApellidos(primerRegistro.Apellidos);
          setEdad(primerRegistro.Edad);
          setSexo(primerRegistro.Sexo);
          setTelefono(primerRegistro.Telefono);
          setCorreo(primerRegistro.Correo_Electronico);
          //datos del vehicul
          setkilometrajeInicial(primerRegistro.Kilometraje_Inicial);
          setNumeroLLave(primerRegistro.Numero_De_Llave);
          setModeloVehiculo(primerRegistro.Modelo_Vehiculo);
          setPlacas(primerRegistro.Placa_Vehiculo);
          setTarjetaGasolina(primerRegistro.Foto_Perfil);

          



        } else {
          console.error('No se encontraron datos válidos en la respuesta');
        }
      } catch (error) {
        console.error('Error al obtener la información del ajustador:', error);
      }
    };

    obtenerImagenDeUsuario();
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h1 style={{ textAlign: 'center' }}>Administración de Cuentas de Ajustador</h1>
      <Row justify="center" align="middle" style={{ minHeight: '70vh' }}>
        <Col xs={24} sm={20} md={16} lg={12} xl={10}>
          <div style={{ background: '#fff', padding: '20px', boxShadow: '0 4px 8px rgba(0,0,0,0.1)', borderRadius: '8px', textAlign: 'left' }}>
          <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Datos del usuario</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Nombre del usuario: {nombreCompleto}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Edad: {edad} años</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Sexo: {sexo}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Telefono: {telefono}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Correo electronico: {correo}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Datos del vehiculo asignado</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Kilometraje inicial: {kilometrajeInicial}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Modelo del vehiculo: {ModeloVehiculo}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Placas: {placas}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Numero de TAG: {NumeroLLave}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Tarjeta de gasolina asignada: {tajetaGasolina}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Datos del telefono asignado</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Nombre del usuario: {nombreCompleto}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Nombre del usuario: {nombreCompleto}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Nombre del usuario: {nombreCompleto}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Nombre del usuario: {nombreCompleto}</p>
            <p style={{ fontSize: '1rem', textAlign: 'center', marginBottom: '20px' }}>Nombre del usuario: {nombreCompleto}</p>





            <div style={{ textAlign: 'center' }}>
              <Button type="primary" onClick={handleLogout}>
                Cerrar Sesión
              </Button>
            </div>
          </div>
        </Col>
      </Row>
    <br></br>
    <br></br>
    <br></br>
    <br></br>
    <br></br>
    <br></br>

    </div>
  );
};

export default AdministracionDeCuentasAjustador;
